{
	"content": [
	{
		"columns": [
		{
			"image": "$accountLogo",
				"fit": [120, 80]
		},
		{
			"text": "",
			"width": "*"
		},
		{
			"width":180,
			"table": { 
				"body": "$invoiceDetails"
			},
			"layout": "noBorders"
		}]
	},
	{
		"image": "data:image/jpeg;base64,",
		"margin": [-40, 16, 0, 0],
		"width": 595
	},
	{
		"margin": [-20, -150, 0, 0],
		"columnGap": 8,
		"columns": [
		{
			"width": "auto",
			"text": "$toLabel:",
			"style": "bold",
			"color":"#cd5138"
		},
		{
			"width": "*",
			"stack": "$clientDetails",
			"margin": [4, 0, 0, 0]
		}
		]
	},
	{
		"margin": [-20, 10, 0, 140],
		"columnGap": 8,
		"columns": [
		{
			"width": "auto",
			"text": "$fromLabel:",
			"style": "bold",
			"color":"#cd5138"
		},
		{
			"width": "*",
			"stack": [
			{
				"width": 150,
				"stack": "$accountDetails"
			},
			{
				"width": 150,
				"stack": "$accountAddress"
			}
			]
		}
		]
	},
	{"canvas": [{ "type": "line", "x1": 0, "y1": 5, "x2": 515, "y2": 5, "lineWidth": 1.5}],"margin":[0,0,0,-30]},
	{
		"style": "invoiceLineItemsTable",
		"table": {
			"headerRows": 1,
			"widths": "$invoiceLineItemColumns",
			"body": "$invoiceLineItems"
		},
		"layout": {
			"hLineWidth": "$notFirst:.5",
			"vLineWidth": "$none",
			"hLineColor": "#000000",
			"paddingLeft": "$amount:8", 
			"paddingRight": "$amount:8", 
			"paddingTop": "$amount:10", 
			"paddingBottom": "$amount:10" 
		}
	},
	{
		"columns": [
			"$notesAndTerms",
		{
			"alignment": "right",
			"table": {
				"widths": ["*", "40%"],
				"body": "$subtotals"
			},
			"layout": {
				"hLineWidth": "$none",
				"vLineWidth": "$none",
				"paddingLeft": "$amount:34", 
				"paddingRight": "$amount:8", 
				"paddingTop": "$amount:4", 
				"paddingBottom": "$amount:4"            
			}
		}]
	},
	"$signature",
	{
		"stack": [
			"$invoiceDocuments"
		],
		"style": "invoiceDocuments"
	}
	],
	"defaultStyle": {
		"fontSize": "$fontSize",
		"margin": [8, 4, 8, 4]
	},
	"footer": {
		"columns": [
		{
			"text": "$invoiceFooter",
			"alignment": "left"
		}
		],
		"margin": [40, -20, 40, 0]
	},
	"styles": {
		"accountDetails": {
			"margin": [0, 0, 0, 3]
		},
		"accountAddress": {
			"margin": [0, 0, 0, 3]
		},
		"clientDetails": {
			"margin": [0, 0, 0, 3]
		},
		"productKey": {
			"color": "$primaryColor:#cd5138"
		},
		"lineTotal": {
			"color": "$primaryColor:#cd5138"
		},
		"tableHeader": {
			"bold": true,
			"fontSize": "$fontSizeLarger"
		},
		"subtotalsBalanceDueLabel": {
			"fontSize": "$fontSizeLargest"
		},
		"subtotalsBalanceDue": {
			"fontSize": "$fontSizeLargest",
			"color": "$primaryColor:#cd5138"
		},
		"invoiceLineItemsTable": {
			"margin": [0, 0, 0, 16]
		},
		"cost": {
			"alignment": "right"
		},
		"quantity": {
			"alignment": "right"
		},
		"tax": {
			"alignment": "right"
		},
		"lineTotal": {
			"alignment": "right"
		},
		"termsLabel": {
			"bold": true,
			"margin": [0, 0, 0, 4]
		},
		"fullheader": {
			"fontSize": "$fontSizeLargest",
			"bold": true
		},
		"help": {
			"fontSize": "$fontSizeSmaller",
			"color": "#737373"
		}
	},
	"pageMargins": [40, 30, 40, 30],
	"background": [
		{
			"image": "$accountBackground",
			"alignment": "center"
		}
	]
}
